import React, { Component } from 'react';

export default class Country extends Component {
  render() {
    const { country } = this.props;
    return (
      <ul>
        {country.map((country) => {
          return (
            <li key={country.id}>
              {country.name}({country.callingCodes})
            </li>
          );
        })}
      </ul>
    );
  }
}
